import React from 'react';
import '../App.css';


function Nav() {
    return (
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <li>Home</li>
                <li>Notifications</li>
                <li>Profile</li>
            </ul>
        </nav>
    );
}

export default Nav;
